syntax "proto3";

package azurerm;

message AzurermContainerRegistryWebhook {
  actions = 1;
  custom_headers = 2;
  id = 3;
  location = 4;
  name = 5;
  registry_name = 6;
  resource_group_name = 7;
  scope = 8;
  service_uri = 9;
  status = 10;
  tags = 11;
  message Timeouts {
    create = 1;
    delete = 2;
    read = 3;
    update = 4;
  }
  timeouts = 12;
}